      SELECT DISTINCT - 51 + + col2 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 * + - col1 * 0 + - col1 BETWEEN ( col0 ) AND - col2 * col0;
  - name: tab2

outputs:
  - name: q2131.out
    data: |
